import React from 'react'
import './Login.css'
export default function Login() {
    return (
        <div>
            <div className="loginContainer">
                <input type="text" className="inputControl" />
                <input type="text" className="inputControl" />
                <button>Đăng nhập</button>
            </div>
        </div>
    )
}
